import React from 'react';
import './App.css';
import logo from './Color.png';
import { Helmet } from 'react-helmet';

function App() {
  return (
    <div>
      <Helmet>
        <title>Educate</title>
        <meta name="description" content="This is my React app" />
        <link rel="icon" href="/favicon.ico" />
      </Helmet>
      <nav>
        <div className="logo">
          <img src={logo} alt="Color logo" />
        </div>
        <ul>
          <li><a href="#about">About Us</a></li>
          <li><a href="#contact">Contact Us</a></li>
          <li><a href="/educator/login">Educator Login</a></li>
          <li><a href="/learner/login">Learner Login</a></li>
        </ul>
      </nav>
      <header>
        <h1>Welcome to the Digital Education Platform</h1>
      </header>
    </div>
  );
}

export default App;
